pragma solidity >=0.8.2 <0.9.0;

/**
 * @title Storage
 * @dev Store & retrieve value in a variable
 * @custom:dev-run-script ./scripts/deploy_with_ethers.ts
 */
contract Election {
    // Keep track of the votes
    uint public chichikoVotes;
    uint public bichikoVotes;

    // Boolean flag to control voting status
    bool public votingActive;

    // Constructor to initialize the voting
    constructor() {
        votingActive = true; // Start voting when the contract is deployed
    }

    // Function to vote for Chichiko, only if voting is still active
    function voteChichiko() public {
        require(votingActive, "Voting is not active");
        chichikoVotes += 1;
    }

    // Function to vote for Bichiko, only if voting is still active
    function voteBichiko() public {
        require(votingActive, "Voting is not active");
        bichikoVotes += 1;
    }

    // Function to stop or start the voting
    function toggleVoting() public {
        votingActive = !votingActive;
    }

    // Function to get the winner
    function getWinner() public view returns (string memory) {
        if (chichikoVotes > bichikoVotes) {
            return "Chichiko is the winner!";
        } else if (bichikoVotes > chichikoVotes) {
            return "Bichiko is the winner!";
        } else {
            return "It's a tie!";
        }
    }
}

